// src/pages/AdminDashboard.js
import React from 'react';

export default function AdminDashboard() {
  // Mock data
  const uidRequests = [
    { name: 'Name 1', department: 'CSE', date: '4 Apr 2025' },
    { name: 'Name 2', department: 'ECE', date: '2 Apr 2025' },
  ];

  const paperSubmissions = [
    { title: 'Title 1', faculty: 'Fac 1', date: '4 Apr 2025', status: 'Approved' },
    { title: 'Title 2', faculty: 'Fac 2', date: '2 Apr 2025', status: 'Approved' },
    { title: 'Title 3', faculty: 'Fac 3', date: '2 Apr 2025', status: 'Pending' },
  ];

  return (
    <div style={styles.container}>
      <h2>R&D Admin Dashboard</h2>

      {/* Summary Cards */}
      <div style={styles.cardsContainer}>
        <SummaryCard title="Faculty UID Request" value="10" />
        <SummaryCard title="Paper Submission" value="5" />
        <SummaryCard title="Approved PIDs" value="2" />
        <SummaryCard title="Incentives Pending" value="3" />
      </div>

      {/* UID Requests Table */}
      <div style={styles.section}>
        <h3>Faculty UID Requests</h3>
        {uidRequests.map((req, index) => (
          <div key={index} style={styles.row}>
            <span>{req.name}</span>
            <span>{req.department}</span>
            <span>{req.date}</span>
            <button style={styles.approveBtn}>Approve</button>
            <button style={styles.rejectBtn}>Reject</button>
          </div>
        ))}
      </div>

      {/* Paper Submissions Table */}
      <div style={styles.section}>
        <h3>Paper Submissions</h3>
        {paperSubmissions.map((paper, index) => (
          <div key={index} style={styles.row}>
            <span>{paper.title}</span>
            <span>{paper.faculty}</span>
            <span>{paper.date}</span>
            <span>Status: {paper.status}</span>
          </div>
        ))}
        <button style={styles.viewBtn}>ðŸ“„ View Approved Publications</button>
      </div>
    </div>
  );
}

function SummaryCard({ title, value }) {
  return (
    <div style={styles.card}>
      <h4>{title}</h4>
      <p>{value}</p>
    </div>
  );
}

const styles = {
  container: {
    padding: '20px',
    fontFamily: 'sans-serif'
  },
  cardsContainer: {
    display: 'flex',
    justifyContent: 'space-between',
    marginBottom: '30px'
  },
  card: {
    flex: '1',
    margin: '0 10px',
    backgroundColor: '#f0f4f8',
    padding: '20px',
    textAlign: 'center',
    borderRadius: '8px',
    boxShadow: '0 2px 6px rgba(0,0,0,0.1)'
  },
  section: {
    marginBottom: '30px'
  },
  row: {
    display: 'flex',
    justifyContent: 'space-between',
    padding: '10px 0',
    borderBottom: '1px solid #ddd'
  },
  approveBtn: {
    backgroundColor: '#4CAF50',
    color: 'white',
    border: 'none',
    padding: '5px 10px',
    cursor: 'pointer'
  },
  rejectBtn: {
    backgroundColor: '#f44336',
    color: 'white',
    border: 'none',
    padding: '5px 10px',
    cursor: 'pointer',
    marginLeft: '5px'
  },
  viewBtn: {
    marginTop: '10px',
    backgroundColor: '#007BFF',
    color: 'white',
    border: 'none',
    padding: '8px 15px',
    cursor: 'pointer'
  }
};
